INSERT INTO CMACAlertText VALUES (1,'English',441,'* WHAT...Heavy snow expected. Total snow accumulations of 4 to 8 inches. North winds gusting up to 35 MPH will cause blowing and drifting snow especially, in open and rural areas.  * WHERE...Portions of northwest Illinois and east central, northeast and southeast Iowa.  * WHEN...From midnight tonight to 6 PM CST Thursday.  * IMPACTS...Plan on slippery road conditions. The hazardous conditions could impact the morning or evening commute. ',110,'Winter Storm Warning issued February 15 at 8:27PM CST until February 16 at 6:00PM CST by NWS Quad Cities IA IL',1);
